import{_ as o,a}from"./chunks/holybro_f9p_gps_qgc_setup.DvIeyTDc.js";import{_ as r,c as t,a8 as i,o as n}from"./chunks/framework.BDnHobkS.js";const b=JSON.parse('{"title":"Holybro H-RTK ZED-F9P RTK Rover (DroneCAN variant)","description":"","frontmatter":{},"headers":[],"relativePath":"en/dronecan/holybro_h_rtk_zed_f9p_gps.md","filePath":"en/dronecan/holybro_h_rtk_zed_f9p_gps.md"}'),l={name:"en/dronecan/holybro_h_rtk_zed_f9p_gps.md"};function s(d,e,h,c,p,u){return n(),t("div",null,e[0]||(e[0]=[i('<h1 id="holybro-h-rtk-zed-f9p-rtk-rover-dronecan-variant" tabindex="-1">Holybro H-RTK ZED-F9P RTK Rover (DroneCAN variant) <a class="header-anchor" href="#holybro-h-rtk-zed-f9p-rtk-rover-dronecan-variant" aria-label="Permalink to &quot;Holybro H-RTK ZED-F9P RTK Rover (DroneCAN variant)&quot;">​</a></h1><p>The <a href="https://holybro.com/collections/h-rtk-gps/products/h-rtk-zed-f9p-rover" target="_blank" rel="noreferrer">H-RTK ZED-F9P Rover</a> RTK GNSS is an upgraded version of the original <a href="./../gps_compass/rtk_gps_holybro_h-rtk-f9p.html">H-RTK F9P Rover</a>.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This topic covers the <a href="./../dronecan/#enabling-dronecan">DroneCAN</a> variant of the module.</p><p>Variants of this module also exist with connectors for the <code>GPS1</code> and <code>GPS2 UART</code> ports. Setup for these is covered in <a href="./../gps_compass/rtk_gps.html#positioning-setup-configuration">RTK GNSS</a>.</p></div><p>This RTK GNSS features the U-Blox ZED-F9P GNSS receiver, RM3100 Compass, and a tri-coloured LED indicator, providing precise positioning and orientation data. The DroneCAN variant includes additional MCU, IMU, and barometer sensors. It also has an IP66 rating, which makes it suitable for challenging environments that require robust protection against dust and water.</p><p><img src="'+o+'" alt="Holybro ZED-F9P"></p><p>This RTK GNSS offers multi-band RTK capabilities with rapid convergence times and consistent performance. It supports concurrent reception of GPS (L1 &amp; L2), GLONASS, Galileo, and BeiDou signals, ensuring reliable and precise positioning. It delivers centimetre-level accuracy with the use of a base station or NTRIP service.</p><p>The high-precision PNI RM3100 compass ensures accurate orientation and stability, offering exceptional reliability, making it ideal for demanding UAV applications. It provides high resolution, low power consumption, large signal noise immunity, a large dynamic range, and high sampling rates. Its measurements are stable over temperature and inherently free from offset drift.</p><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><ul><li><a href="https://holybro.com/collections/h-rtk-gps/products/h-rtk-zed-f9p-rover" target="_blank" rel="noreferrer">Holybro</a></li></ul><h2 id="hardware-specifications" tabindex="-1">Hardware Specifications <a class="header-anchor" href="#hardware-specifications" aria-label="Permalink to &quot;Hardware Specifications&quot;">​</a></h2><ul><li>Sensors <ul><li>Ublox ZED-F9P GPS <ul><li>Centimetre-level accuracy RTK positioning</li><li>IP66 Dust and Water Resistant</li><li>EMI Shielding for more accurate GNSS performance</li><li>Out of the box moving baseline support</li></ul></li><li>RM3100: High-precision low-noise compass</li></ul></li><li>DroneCAN sensors (additional sensors in DroneCAN variant) <ul><li>MCU: STM32G4</li><li>IMU: Invensense ICM-42688</li><li>Barometer: ICP20100</li></ul></li><li>Two JST GH CAN connectors (via pigtail)</li><li>LED Indicators <ul><li>Tri-coloured LED indicator</li></ul></li><li>Key Specifications <ul><li>Working Temperature: -40C to 85C</li><li>Input power: 4.75-5.25V</li><li>Current Consumption: 250 mA</li><li>Weight: 117 grams</li></ul></li></ul><h2 id="hardware-setup" tabindex="-1">Hardware Setup <a class="header-anchor" href="#hardware-setup" aria-label="Permalink to &quot;Hardware Setup&quot;">​</a></h2><h3 id="wiring" tabindex="-1">Wiring <a class="header-anchor" href="#wiring" aria-label="Permalink to &quot;Wiring&quot;">​</a></h3><p>The Holybro ZED-F9P GPS is connected to the CAN bus using a Pixhawk standard 4 pin JST GH cable. For more information, refer to the <a href="./../can/#wiring">CAN Wiring</a> instructions.</p><p>For dual F9P setups leveraging GPS yaw, connect both F9P CAN connectors to the same bus via a CAN or I2C expansion splitter or <a href="https://holybro.com/products/can-hub?_pos=1&amp;_sid=eeb6b74b2&amp;_ss=r" target="_blank" rel="noreferrer">hub</a>.</p><h2 id="firmware-setup" tabindex="-1">Firmware Setup <a class="header-anchor" href="#firmware-setup" aria-label="Permalink to &quot;Firmware Setup&quot;">​</a></h2><p>Holybro ZED-F9P GPS boards ship with &quot;AP Periph&quot; (Ardupilot DroneCAN firmware) already installed.</p><p>To update the &quot;AP Periph&quot; firmware to the latest version:</p><ol><li><a href="https://firmware.ardupilot.org/AP_Periph/latest/HolybroG4_GPS/" target="_blank" rel="noreferrer">Download the latest binary</a>.</li><li>Update the firmware using either of the following approaches: <ul><li>Using ArduPilot: <ol><li>Install <em>Ardupilot</em> firmware on your flight controller and the Mission Planner GCS on your computer.</li><li>Update the binary by following the instructions in the <a href="https://docs.holybro.com/gps-and-rtk-system/zed-f9p-h-rtk-series/dronecan-fw-upgrade" target="_blank" rel="noreferrer">DroneCAN FW Upgrade</a> guide.</li></ol></li><li>Use a serial-to-can converter (such as the <a href="https://github.com/Zubax/canface_cf1?tab=readme-ov-file" target="_blank" rel="noreferrer">Zubax Babel</a>) and the <a href="https://dronecan.github.io/Implementations/Libuavcan/Tutorials/11._Firmware_update/" target="_blank" rel="noreferrer">DroneCAN GUI Tool</a>.</li></ul></li></ol><p>Remember to change the firmware on the flight controller back to PX4 afterwards.</p><h3 id="enable-dronecan" tabindex="-1">Enable DroneCAN <a class="header-anchor" href="#enable-dronecan" aria-label="Permalink to &quot;Enable DroneCAN&quot;">​</a></h3><p>In order to use the Holybro ZED-F9P GPS board, connect it to the Pixhawk CAN bus and enable the DroneCAN driver by setting parameter <a href="./../advanced_config/parameter_reference.html#UAVCAN_ENABLE">UAVCAN_ENABLE</a> to <code>2</code> for dynamic node allocation (or <code>3</code> if using <a href="./../dronecan/escs.html">DroneCAN ESCs</a>).</p><p>The steps are:</p><ol><li>In <em>QGroundControl</em> set the parameter <a href="./../advanced_config/parameter_reference.html#UAVCAN_ENABLE">UAVCAN_ENABLE</a> to <code>2</code> or <code>3</code> and reboot (see <a href="./../advanced_config/parameters.html">Finding/Updating Parameters</a>).</li><li>Connect Holybro ZED-F9P GPS CAN to the Pixhawk CAN.</li></ol><p>Once enabled, the module will be detected on boot and assigned a dynamic node ID via PX4.</p><p>DroneCAN configuration in PX4 is explained in more detail in <a href="./../dronecan/#enabling-dronecan">DroneCAN &gt; Enabling DroneCAN</a>.</p><h3 id="sensor-position-configuration" tabindex="-1">Sensor Position Configuration <a class="header-anchor" href="#sensor-position-configuration" aria-label="Permalink to &quot;Sensor Position Configuration&quot;">​</a></h3><ul><li>For the the single Rover the module should be mounted with the included mast.</li><li>For the Dual ZED-F9P setup (moving baseline), the DroneCAN modules should be placed at least 30cm apart on the airframe and elevated on a mast also. See the following <a href="https://holybro.com/products/30-antenna-mount?_pos=20&amp;_sid=67b49d76b&amp;_ss=r" target="_blank" rel="noreferrer">mast</a>.</li><li>F9P module arrow(s) should be pointing forward with respect to the autopilot orientation.</li></ul><h2 id="dual-zed-f9p-dronecan-modules-for-heading" tabindex="-1">Dual ZED-F9P DroneCAN Modules For Heading <a class="header-anchor" href="#dual-zed-f9p-dronecan-modules-for-heading" aria-label="Permalink to &quot;Dual ZED-F9P DroneCAN Modules For Heading&quot;">​</a></h2><p>In order to use dual ZED-F9P GPS heading in PX4, follow these steps:</p><ol><li><p>Open the QGroundControl parameters page.</p></li><li><p>On the left side next to the parameters list, double-click on the <em>System</em> section (this hides the section).</p></li><li><p>Components should be visible on the left panel. Click on the first <code>_Component_&lt;ID#&gt;</code> that maps to the ZED-F9P DroneCAN node (below shown as <em>Component 124</em>).</p></li><li><p>Click on the <em>GPS</em> subsection and configure the parameters listed below:</p><ul><li><code>GPS_TYPE</code>: Either set to <code>17</code> for moving baseline <em>base</em>, or set to <code>18</code> to be the moving baseline <em>rover</em>. One F9P MUST be <em>rover</em>, and the other MUST be <em>base</em>.</li><li><code>GPS_AUTO_CONFIG</code>: set to 1 for both the rover and base</li><li><code>GPS_POS_X</code>, <code>GPS_POS_Y</code>, <code>GPS_POS_Z</code>: This is the antenna placement, which for the F9P is internal to the module. This is the local offset (FRD) with respect to the autopilot.</li></ul></li></ol><p><img src="'+a+'" alt="QGC Setup"></p><p>Then in order to enable the subscription in DroneCAN, enable the following PX4 autopilot params:</p><ul><li><a href="./../advanced_config/parameter_reference.html#UAVCAN_ENABLE">UAVCAN_ENABLE</a>: Set to <code>1</code> to enable DroneCAN in PX4</li><li><a href="./../advanced_config/parameter_reference.html#EKF2_GPS_CTRL">EKF2_GPS_CTRL</a>: Set to <code>15</code> to enable Dual antenna heading.</li><li><a href="./../advanced_config/parameter_reference.html#UAVCAN_SUB_GPS_R">UAVCAN_SUB_GPS_R</a>: Set to <code>1</code> to enable subscription to GNSS relative.</li><li><a href="./../advanced_config/parameter_reference.html#GPS_YAW_OFFSET">EKF2_GPS_YAW_OFF</a>: Set to the clockwise angle (degrees) corresponding to base and rover orientation (e.g. 90 degrees when moving base to the left and rover to the right)</li></ul><p>Once these params are enabled and the F9Ps are mounted to the airframe (assuming valid RTK fix) the LED&#39;s on both F9Ps should turn green.</p><p>Note that the Dual F9P heading is only accurate/valid if at least one F9P&#39;s are reporting a status of <code>RTK Fixed (6)</code>. This means that dual heading will not work indoors or in areas with GPS interference/lack of coverage.</p>',36)]))}const g=r(l,[["render",s]]);export{b as __pageData,g as default};
